var object=require("..");describe(".keys(obj)",function(){it("should return the keys of an object",function(){var e={name:"tobi",age:1};object.keys(e).should.eql(["name","age"])})}),describe(".values(obj)",function(){it("should return the values of an object",function(){var e={name:"tobi",age:1};object.values(e).should.eql(["tobi",1])})}),describe(".length(obj)",function(){it("should return key count",function(){var e={name:"tobi",age:1};object.length(e).should.equal(2)})}),describe(".merge(a, b)",function(){it("should merge two objects",function(){var e={foo:"bar"},t={bar:"baz"};object.merge(e,t).should.eql({foo:"bar",bar:"baz"})}),it("should give precedence to b",function(){var e={foo:"bar"},t={foo:"baz"};object.merge(e,t).should.eql({foo:"baz"})})}),describe(".isEmpty()",function(){it("should check if the object is empty",function(){object.isEmpty({}).should.be["true"],object.isEmpty({foo:"bar"}).should.be["false"]})});